import { ReactNode } from 'react';
import { Cell, IconContainer, Section, Image } from '@telegram-apps/telegram-ui';

import { Icon28Heart } from '@telegram-apps/telegram-ui/dist/icons/28/heart';
import { Icon28Devices } from '@telegram-apps/telegram-ui/dist/icons/28/devices';
import { Icon28Stats } from '@telegram-apps/telegram-ui/dist/icons/28/stats';

type CellProps = {
  id: number;
  icon: ReactNode;
  text: string;
  subtitle: string;
}

const cells: CellProps[] = [
  {
    id: 1,
    icon: <Icon28Heart />,
    text: 'Учёба',
    subtitle: 'Форум • кружки • материалы',
  },
  {
    id: 2,
    icon: <Icon28Heart />,
    text: 'Студ. актив',
    subtitle: 'Клубы • события • движ',
  },
  {
    id: 3,
    icon: <Icon28Heart />,
    text: 'Преподаватели',
    subtitle: '',
  },
  {
    id: 4,
    icon: <Icon28Heart />,
    text: 'Библиотека',
    subtitle: '',
  },
  {
    id: 5,
    icon: <Icon28Heart />,
    text: 'Свободные аудитории',
    subtitle: '',
  },
];

export const CellMainSection = () => (
  <Section>
    {cells.map((cell) => (
      <Cell
        key={cell.id}
        before={<Image>{<IconContainer>{cell.icon}</IconContainer>}</Image>}
        subtitle={cell.subtitle}
      >
        {cell.text}
      </Cell>
    ))}
  </Section>
);
